import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import './Homepage.css'; // Import your own CSS file for styling

const Homepage = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  return (
    <div className="slider-container">
      <Slider {...settings}>
        <img src="cow1.jpg" alt="Cow 1" className="slick-image" />
        <img src="cow2.jpg" alt="Cow 2" className="slick-image" />
        <img src="cow3.jpg" alt="Cow 3" className="slick-image" />
      </Slider>
    </div>
  );
};

export default Homepage;
